import React from 'react';
import Typography from '@material-ui/core/Typography';
import SecondaryLayout from "../_layouts/default/SecondaryLayout";
import PageCaptionSpacer from "../common/PageCaptionSpacer";
import SuggestForm from "./SuggestForm/SuggestForm";
import {Btn, ButtonsGroup, FormWrapper, InnerFormSpacer, Title} from "../common/form_components";

const getDefaultState = () => {
    let typeVariant = {
        long: {
            value: false,
        },
        short: {
            value: false
        },
    }

    let description = ''

    return ({
        typeVariant,
        description,
    })
}

function SuggestContainer(props) {

    const [state, setState] = React.useState(getDefaultState())

    return (
        <SecondaryLayout>
            <PageCaptionSpacer/>

            <FormWrapper maxWidth="xl">
                <InnerFormSpacer>
                    <Title text="Письмо дизайнеру"/>
                    
                    <SuggestForm/>
                    <ButtonsGroup left>
                        <Btn variant="outlined">Назад</Btn>
                        <Btn variant="contained">Предложить</Btn>
                    </ButtonsGroup>

                </InnerFormSpacer>
            </FormWrapper>

        </SecondaryLayout>
    );
}

export default SuggestContainer
